//Map that pins chosen cities

const Map = () => {
    const L = window.L;
    const map = L.map('map)').setView()

    L.tileLayer('https://{s}.tile.openstreetmap.org/{z}/{x}/{y}.png', {
        maxZoom: 19,
        attribution: '© OpenStreetMap'
    }).addTo(map);
}

export default Map;
